  \"A synthesis of population dynamics, forage relationships, habitat use, and distributions;
  and model-based analyses of a variety of possible new management scenarios for bison
  and elk\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-10-29T18:58:01.193228\",\n\t\"name\":
  \"a-synthesis-of-population-dynamics-forage-relationships-habitat-use-and-distributions-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Agency managers from the National Park
  Service (NPS), the U.S. Fish and Wildlife Service (USFWS), the U.S. Forest Service
  (USFS) and the Wyoming Game and Fish Department (WGFD), in the Jackson Hole area,
  require additional quantitative biological information concerning the Jackson bison
  (Bison bison) herd and its environment. Additional information is needed about the
  spatial and dynamic interactions among plants, bison, elk (Cervus elaphus), and
  cattle (Bos taurus). More specifically, there is a need to assess and predict the
  carrying capacity of the winter ranges for bison and elk, and potential interactions
  among bison, elk, and cattle under different management scenarios on this potential
  winter range. This will require collection and synthesis of new and existing information
  about: 1) forage production and distribution, 2) snow cover, 3) interactions of
  bison with other species, especially elk, 4) bison and elk population dynamics,
  5) bison and elk distribution, 6) habitat requirements, and 7) forage utilization.
  A spatial-dynamic model is recommended to estimate and predict carrying capacity
  and interspecific interactions.  The primary purpose of this proposed investigation
  is to use a combination of field data collection, ecological modeling, and synthesis
  to assess and predict the carrying capacity of native winter ranges for elk and
  bison and resultant interspecific interactions under different scenarios of supplemental
  feeding and other management tactics.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
